    <style>
        *{
            font-family: 'Poppins', sans-seriff;
        }

        h1{
        color: rgb(255, 0, 238)
        }

        .center{
            display: block;
            margin-left: auto;
            margin-right: auto;
            width: 50%;
        }
        a:link {
            color: rgb(113, 20, 95); 
          background-color: transparent; 
          text-decoration: none;        
        }

    a:visited {          
        color: rgb(113, 20, 95);
        background-color: transparent;
        text-decoration: none;    
    }

    a:hover {
      color: rgb(113, 20, 95);
      background-color: transparent;
      text-decoration: underline;  
    }

    a:active {
      color: rgb(113, 20, 95);
      background-color: transparent;
      text-decoration: underline; 
    }

    nav{
        display: flex;
        padding: 2% 6%;
        justify-content: space-between;
        align-items: center;
    }

    .nav-links{
        flex: 1;
        text-align: right;
    }

    .nav-links ul li{
        list-style: none;
        display: inline-block;
        padding: 8px 12px;
        position: relative;
    }

    .nav-links ul li a{
        color: coral;
        text-decoration: none;
        font-size: 13 px;
    }

    .nav-links ul li::after{
        content: '';
        width: 0%;
        height: 2px;
        background: coral;
        display: block;
        margin: auto;
        transition: 0.5s;
    }

    .nav-links ul li:hover::after{
        width: 100%
    }

    .h3{
        flex: 1;
        text-align: right;
    }
